import React from "react";
import "./colletioncard.css";

const Collectioncard = (props) => {
  return (
    <div className="collection card">
      <img src={props.pic} alt="punk pic" />
      <p>{props.name}</p>
      <p>{props.id}</p>
      <p>{props.rate}</p>
      <p>{props.img}</p>
    </div>
  );
};

export default Collectioncard;
